import Layout from '../components/Layout'

const api_url = "https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan"

const Index = () => (
    <Layout>
        <div>
            <h1>Velkommen</h1>
            <p>hey</p>
        </div>
    </Layout>
);

const res = fetch(api_url, {
    method: "POST",
    headers: {
        "Content-Type": "application/json"
    },
    body: JSON.stringify(
        {
            "laanebelop": 200000,
            "nominellRente": 3,
            "terminGebyr": 30,
            "utlopsDato": "2030-01-01",
            "saldoDato": "2020-01-01",
            "datoForsteInnbetaling": "2020-02-01",
            "ukjentVerdi": "TERMINBELOP" 
        }
    )
})

const data = res.json()
console.log(data)

export default Index;
